import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <div style={{display:'flex', justifyContent:'center'}}>
          <form>
            <label style={{marginRight:10}}>
              CUI:
              <input type="text" name="name" style={{marginRight:10}}/>
            </label>
            <input type="submit" value="Submit" />
          </form>
          </div>
    </div>
  );
}

export default App;
